import { Button } from "@mui/material";

const DashBoard = (props) => {


    const logout = (e) => {
        e.preventDefault();
        localStorage.removeItem("token");
        props.setAuth(false);
    }

    return (
        <div>
            <h1>Welcome!</h1>
            <Button variant="contained" onClick={e => logout(e)}>Logout</Button>
        </div>
    );
}

export default DashBoard;
